/// Quadrotor tracking example
///
/// This script is just to show how to use the library, the data for this example is not tuned for our Crazyflie demo. Check the firmware code for more details.
///
///     - NSTATES = 12
///     - NINPUTS = 4
///     - NHORIZON = anything you want
///     - NTOTAL = 301 if using reference trajectory from trajectory_data/
///     States: x (m), y, z, phi, theta, psi, dx, dy, dz, dphi, dtheta, dpsi
///     phi, theta, psi are NOT Euler angles, they are Rodiguez parameters
///     check this paper for more details: https://ieeexplore.ieee.org/document/9326337
///     Inputs: u1, u2, u3, u4 (motor thrust 0-1, order from Crazyflie)
///
use log::debug;
use nalgebra::{DMatrix, DVector};
use tinympc::TinySolver;

const NSTATES: usize = 12;
const NINPUTS: usize = 4;

const NHORIZON: usize = 10;
const NTOTAL: usize = 301;

fn main() {
    env_logger::init();
    let a = DMatrix::from_vec(NSTATES, NSTATES, A.to_vec()).transpose();
    let b = DMatrix::from_vec(NINPUTS, NSTATES, B.to_vec()).transpose();
    let q = DMatrix::from_diagonal(&DVector::from_vec(Q.to_vec()));
    let r = DMatrix::from_diagonal(&DVector::from_vec(R.to_vec()));

    let mut mpc = TinySolver::new(
        a.clone(),
        b.clone(),
        q,
        r,
        RHO,
        NSTATES,
        NINPUTS,
        NHORIZON,
        DMatrix::from_element(NSTATES, NHORIZON, -5.0),
        DMatrix::from_element(NSTATES, NHORIZON, 5.0),
        DMatrix::from_element(NINPUTS, NHORIZON - 1, -0.5),
        DMatrix::from_element(NINPUTS, NHORIZON - 1, 0.5),
    );

    // Update whichever settings we'd like
    mpc.settings.max_iter = 100;

    // Map data from trajectory_data
    let xref_total = DMatrix::from_vec(NSTATES, NTOTAL, XREF_DATA.to_vec());
    mpc.set_x_ref(xref_total.view_range(0..NSTATES, 0..NHORIZON).into());

    // Initial state
    let mut x0 = mpc.x_ref();

    // Track total iterations across all MPC solves
    let mut total_iterations = 0;

    let mut total_tracking_error = 0.0;

    for k in 0..NTOTAL - NHORIZON {
        let current_error = (&x0 - mpc.x_ref_at(1)).norm();
        total_tracking_error += current_error;

        debug!("tracking error: {}", current_error);

        // 1. Update measurement
        mpc.set_x0(x0.clone());

        // 2. Update reference
        mpc.set_x_ref(xref_total.view_range(0..NSTATES, k..k + NHORIZON).into());

        // 3. Reset dual variables if needed
        mpc.reset_y();
        mpc.reset_g();

        // 4. Solve MPC problem
        mpc.solve();

        // 5. Track iterations
        total_iterations += mpc.solution.iter;
        debug!(
            "Iterations for step {k}: {} (cumulative: {total_iterations})",
            mpc.solution.iter
        );

        // 5. Simulate forward
        x0 = &a * &x0 + &b * mpc.u();
    }

    debug!("Total iterations across all MPC solves: {total_iterations}");
    debug!(
        "Average tracking error: {}",
        total_tracking_error / mpc.settings.max_iter as f64
    );
}

